        public async Task Seed()
        {
            var users = userManager.Users.ToList();

            var rnd = new Random();

            var properties = new List<Property>();
            var propertyPictures = new List<PropertyPicture>();

            for (var i = 0; i < 100; i++)
            {
                var type = rnd.Next(1, 3);
                properties.Add(new Property
                {
                    Type = type,
                    Title = titles[rnd.Next(titles.Length - 1)],
                    Description = descriptions[rnd.Next(descriptions.Length - 1)],
                    Price = type == 1 ? rnd.Next(100000, 10000000) : rnd.Next(1000, 10000),
                    Bedrooms = rnd.Next(1,5),
                    Bathrooms = rnd.Next(1,3),
                    Garage = rnd.Next(1,2),
                    SquareMeters = rnd.Next(100, 650),
                    YearBuilt = rnd.Next(1976, DateTime.Now.Year),
                    Address = addresses[rnd.Next(addresses.Length - 1)],
                    Features = string.Join(",", features.Take(rnd.Next(features.Length - 1))),
                    NearbyAmenities = string.Join(",", Ð°menities.Take(rnd.Next(Ð°menities.Length - 1))),
                    ClosedDate = i % 3 == 0 ? null : new DateOnly(rnd.Next(1970, DateTime.Now.Year), rnd.Next(1,12), rnd.Next(1,28)),
                    UserId = users[rnd.Next(users.Count - 1)].Id
                });

                for (var j = 0; j < 3; j++)
                {
                    propertyPictures.Add(new PropertyPicture()
                    {
                        PropertyId = properties.Count,
                        Picture = pictures[rnd.Next(pictures.Length - 1)],
                    });
                }
            };

            Properties.AddRange(properties);
            PropertyPictures.AddRange(propertyPictures);
            await SaveChangesAsync();
        }
